  false,\n\t\"url\": null,\n\t\"notes\": \"This map is a statewide summary of magmatic
  (igneous) rocks grouped into geologic units that can be portrayed cartographically
  at 1:2,500,000. This dataset consists of a polygon coverage and associated attribute
  data derived from the 1994 map \"Latest Cretaceous and Cenozoic magmatic rocks of
  Alaska\" compiled by E.J. Moll-Stalcup, D.A. Brew, and T.L. Vallier. This map was
  originally published ( at 1:2,5000,0000) as Plate 5 in Volume G-1, \"The Geology
  of Alaska\", edited by G. Plafker and H.C. Berg, and published by the Geological
  Society of America (GSA). Volume G-1 (The Geology of Alaska) is one of a series
  published by GSA for the Decade of North American Geology (DNAG), and is often referred
  to as the DNAG-Alaska volume. This digital dataset includes all 44 magmatic rock
  units from the original map, including dredged and outcrop sampled areas. It includes
  attributes for rock age (6 groups), composition (8 groupings), ranges and combinations
  of age and composition; and the location of hypabyssal or agglomeratic/tuffaceous
  units (TYPE = H or T) This coverage is not intended to be a complete representation
  of the printed map. It does NOT include the following features: locations of calderas
  or volcanoes; inset maps of magmatic provinces; or explanatory text (introduction
  and references).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
